import {
  Box,
  FormControl,
  Grid,
  InputLabel,
  MenuItem,
  Select,
} from "@mui/material";
import React from "react";
import Announcement from "../components/Announcement";
import Footer from "../components/Footer";
import Navbar from "../components/Navbar";
import Newsetter from "../components/Newsetter";
import Products from "../components/Products";

const ProductList = () => {
  const [age, setAge] = React.useState("");

  const handleChange = (event) => {
    setAge(event.target.value);
  };
  return (
    <Box>
      <Announcement />
      <Navbar />
      <Grid container>
        <Grid item md={3} sm={6}>
          <FormControl>
            <InputLabel id="filter-products-label">Filter Products:</InputLabel>
            <Select
              labelId="filter-products-label"
              id="filter-products"
              value={age}
              label="Filter Products"
              onChange={handleChange}
            >
              <MenuItem value={10}>Ten</MenuItem>
              <MenuItem value={20}>Twenty</MenuItem>
              <MenuItem value={30}>Thirty</MenuItem>
            </Select>
          </FormControl>
        </Grid>
        <Grid item md={3} sm={6}>
          <FormControl>
            <InputLabel id="Sort-products-label">Sort Products:</InputLabel>
            <Select
              labelId="sort-products-label"
              id="sort-products"
              value={age}
              label="Sort Products"
              onChange={handleChange}
            >
              <MenuItem value={10}>Ten</MenuItem>
              <MenuItem value={20}>Twenty</MenuItem>
              <MenuItem value={30}>Thirty</MenuItem>
            </Select>
          </FormControl>
        </Grid>
      </Grid>
      <Products />
      <Newsetter />
      <Footer />
    </Box>
  );
};

export default ProductList;
